import  React  from "react";
import {ProgressBar} from 'primereact/progressbar';


class check extends React.Component{
    constructor()
    {
        super();
    }

    render(){
        return(
            <div className="col-xl-3 col-md-6">
              <div className="card" style={{height:"360px"}}>
                <div className="card-body">
                    <span>Highest Active Cases</span><hr></hr>
                    <span style={{float:"left"}}>USA</span>
                    <ProgressBar value="40"  style={{height:'16px',fontSize:"12px"}} /><br></br>
                    <span>Highest Recovery Rate</span><hr></hr>
                    <span style={{float:"left"}}>USA</span>
                    <ProgressBar value="40"  style={{height:'21px'}} /><br></br>
                    <span>Highest Death Rate</span><hr></hr>
                    <span style={{float:"left"}}>USA</span>
                    <ProgressBar value="40"  style={{height:'21px'}} />

                </div>
              </div>
            </div>
        )
    }
}

export default check;
